svg.script:

var sections = document.querySelectorAll("svg > g");
nodes = [sections[1]]
for (i=2;i<sections.length;i++){
    sections[i].style = "display:none;"
    nodes.push(sections[i])
}
var c = 0
function next()
{
    nodes[c].style = "display:none;"
    c = (c + 1) % nodes.length
    nodes[c].style = ""
}
